def snt1(num):
  return all(num % i != 0 for i in range(2, int(num ** 0.5) + 1))

def snt(n):
  for i in range(2, int(n**0.5) + 1):
      if n % i == 0 and snt1(i):
          count = 0
          while n % i == 0:
              n /= i
              count += 1
          if n == 1:
              return i, count
          else:
              return 0, 0
  if n > 1:
      return n, 1
  return 0, 0

